import React from 'react';

const Footer = () => {
  return (
    <div className='footer'>
      <nav
        className='navbar navbar-light'
        style={{ backgroundColor: '#A9A9B2' }}
      >
        <hr />
        {/* <p>{props.footerText}</p> */}
        <h5 style={{ position: 'textAlign' }}>Footer</h5>
      </nav>
    </div>
  );
};

export default Footer;
